class UsabilityRefactoring {
    initialize () {}
    transform () {}
    applyStyle () {}

    execute () {
        this.initialize();
        this.transform();
        this.applyStyle();
    }

    isOnElement () {
        return false;
    }

    serialize () {
        return {"refactoring": this.constructor.name}
    }

    createRefactoring(json) {
        return new window[json.refactoring](json);
    }
}

export default UsabilityRefactoring;
